import "./vaccineScreen.css";
import "../../styles/layout.css";

function VaccineScreen({ onNext }) {
  const handleClick = () => {
    setTimeout(() => {
      onNext();
    }, 600); // 애니메이션 끝난 뒤 전환
  };

  return (
    <div className="mobile vaccineScreen" onClick={handleClick}>
      <div>vaccineScreen</div>
    </div>
  );
}

export default VaccineScreen;
